# https://leetcode.com/problems/repeated-dna-sequences/description/
import time
s = ""
seen = set()
double = set()

for i in range (0, (len(s)-9)):
    a = s[i:i+10]
    if a in seen:
        double.add(a)
    else:
        seen.add(a)
print(list(double))
